import React, { Component } from 'react';

class CatCard extends Component {
    componentDidMount(){
        fetch('http://aws.random.cat/meow')
        .then(response => response.json())
        .then(data => this.setState({ totalReactPackages: data.total }))
    }
    render() {
        return (
            <div class="card">
                <img></img>
                <p>Nom du chat</p>
            </div>
        );
    }
}

export default CatCard;
